import React from 'react';

const Home = () => {
    return(
        <div>
            <h2>Pokedex</h2>
            <nav>
                <ul>
                    <li>Pokemon List</li>
                    <li>About</li>
                </ul>
            </nav>
        </div>
    )
}

export default Home;
